import React, { Component } from "react";
import { Link, Redirect, withRouter } from "react-router-dom";
import "./Test.css";
import axios from "axios";
import authService from "../../services/auth-service";
import axiosService from "../../services/axios-service";
import { API_URL } from "../../services/url";
export class Testfive extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: ""
      //    pin : ""
    };
    this.onSubmit = this.onSubmit.bind(this);
  }

  change = e => {
    this.setState({
      [e.target.name]: e.target.value
    });
  };
  getWebsite = () => {
    fetch("/").then(console.log(this.state));
  };
  async onSubmit(event) {
    event.preventDefault();
    console.log(this.state);
    try {
      const response = await axios.post(
        `${API_URL}zone/add`,
        this.state,
        (axios.defaults.headers.common["authorization"] =
          "Bearer " + authService.getToken())
      );
      console.log(response);
      //   .then(console.log(this.state));

      //   if (response.data.success) {
      //     alert(response.data.msg);
      //     this.props.history.push("/ZoneLoc");
      //   } else {
      //     alert(response.data.msg);
      //   }
    } catch (error) {
      console.log(error);
    }
  }
  render() {
    return (
      <div className="skin-blue fixed-layout">
        <div className="page-wrapper">
          <div className="container-fluid">
            <div className="row page-titles">
              <div className="col-md-5 align-self-center">
                {/* <h4 className="text-themecolor">Forms</h4> */}
                <nav aria-label="breadcrumb">
                  <ol class="breadcrumb">
                    <li className="breadcrumb-item">
                      <Link to={process.env.PUBLIC_URL + "/"}>Home</Link>
                    </li>
                    <li className="breadcrumb-item active" aria-current="page">
                      Add Test
                    </li>
                  </ol>
                </nav>
              </div>
            </div>
          </div>

          {/*Form content begin */}

          <div className="product-form-upper">
            <div className="container">
              <div className="below-custom-form">
                <div className="row">
                  <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <h3>Add Test</h3>
                  </div>
                </div>
                <form className="custom-content-form" method="POST">
                  <div class="form-row">
                    <div class="form-group col-md-12">
                      <label for="inputCategory">Enter Name*(unique) </label>
                      <input
                        type="text"
                        className="form-control"
                        name="name"
                        value={this.state.name}
                        onChange={e => this.change(e)}
                      />
                    </div>
                    {/* <div class="form-group col-md-6">
    <label for="inputSubcategory">Enter Pin*</label><br />              
     <input type="number" className = "form-control" placeholder="min 6 digits" name="pin" value={this.state.pin} onChange={e => this.change(e)} />
    </div> */}
                  </div>

                  <button class="btn btn-primary" onClick={this.onSubmit}>
                    Submit
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Testfive;
